import React, { useState } from 'react';
import PasswordGate from './PasswordGate';
import DiaryEditor from './components/DiaryEditor';
import DiaryList from './components/DiaryList';
import BuyMeACoffee from './components/BuyMeACoffee';
import SideNote from './components/SideNote';

function App() {
  const [refreshList, setRefreshList] = useState(0);
  const [showEditor, setShowEditor] = useState(false);
  const [unlocked, setUnlocked] = useState(() => sessionStorage.getItem('diary_unlocked') === 'true');
  if (!unlocked) {
    return <PasswordGate onUnlock={() => {
      setUnlocked(true);
      sessionStorage.setItem('diary_unlocked', 'true');
    }} />;
  }
  return (
    <div className="app-container min-h-screen bg-gradient-to-br from-pink-100 via-blue-100 to-purple-100 flex flex-col items-center py-4 px-2" style={{maxWidth: '100vw', width: '100vw', overflowX: 'hidden', boxSizing: 'border-box'}}>
      <header className="mb-4 w-full max-w-full mx-auto px-2">
        <h1 className="text-3xl sm:text-4xl font-extrabold text-center text-pink-500 mb-2 font-cursive tracking-wide" style={{wordBreak: 'break-word'}}>
          DiaryMe
        </h1>
        <p className="text-center text-purple-400 font-cursive text-base sm:text-lg">Your private, cute diary app</p>
        <div className="w-full flex justify-center gap-2 mt-2 flex-wrap">
          <SideNote />
        </div>
      </header>
      <main className="w-full max-w-full mx-auto flex flex-col gap-4 px-0 sm:px-2">
        <section className="bg-white/90 rounded-3xl shadow-xl p-4 flex flex-col items-center border-2 border-pink-200 w-full" style={{maxWidth: '100%', boxSizing: 'border-box', padding: '16px'}}>
          <div className="w-full mb-4 text-center text-lg text-purple-500 font-cursive">How are you feeling today?</div>
          <div className="w-full flex flex-row gap-1 mb-2 justify-end items-center">
            {!showEditor && (
              <button
                className="bg-gradient-to-r from-pink-400 via-blue-400 to-purple-400 text-white px-2 py-1 rounded-full font-extrabold shadow hover:scale-105 transition-transform duration-200 text-xs sm:text-lg font-cursive w-auto"
                onClick={() => setShowEditor(true)}
                style={{minWidth: 0, maxWidth: '40px', wordBreak: 'break-word'}}
              >
                <span className="sm:hidden">üìù</span>
                <span className="hidden sm:inline">+ Create New Entry</span>
              </button>
            )}
            <button className="bg-blue-200 text-blue-700 px-2 py-1 rounded-full font-bold shadow w-auto font-cursive text-xs sm:text-lg" style={{minWidth: 0, maxWidth: '40px', wordBreak: 'break-word'}}>
              <span className="sm:hidden">‚¨áÔ∏è</span>
              <span className="hidden sm:inline">Download</span>
            </button>
          </div>
          {showEditor && (
            <div className="relative w-full">
              <button
                className="absolute top-2 right-2 bg-red-400 text-white rounded-full px-3 py-1 text-xs font-bold shadow hover:bg-red-500 z-10 font-cursive"
                onClick={() => setShowEditor(false)}
                aria-label="Close editor"
              >
                √ó
              </button>
              <DiaryEditor
                onSave={() => {
                  setRefreshList(r => r + 1);
                  setShowEditor(false);
                }}
              />
            </div>
          )}
        </section>
        <section className="bg-white/90 rounded-3xl shadow-xl p-4 border-2 border-blue-200 w-full" style={{maxWidth: '100%', boxSizing: 'border-box', padding: '16px'}}>
          <DiaryList refresh={refreshList} />
        </section>
      </main>
      <div className="w-full flex flex-row gap-1 mt-6 mb-2 justify-end items-center px-2" style={{padding: '16px'}}>
        <div className="w-auto">
          <BuyMeACoffee />
        </div>
      </div>
      <style>{`
        .font-cursive { font-family: 'Comic Sans MS', 'Comic Sans', cursive; }
        @media (max-width: 480px) {
          .rounded-3xl { border-radius: 1.5rem; }
          .shadow-xl { box-shadow: 0 4px 24px 0 rgba(0,0,0,0.08); }
          .p-4 { padding: 1rem !important; }
          .mb-4 { margin-bottom: 1rem !important; }
          .w-full { width: 100% !important; }
          .max-w-full { max-width: 100vw !important; }
          .flex-col { flex-direction: column !important; }
          .gap-2 { gap: 0.5rem !important; }
          .px-2 { padding-left: 0.5rem !important; padding-right: 0.5rem !important; }
        }
      `}</style>
    </div>
  );
}

export default App;
